import {Link} from 'react-router-dom';

export const NavBarCompany = () => {
  console.log('adfeaieh')
  return (
    <div className='navbar'>
      <div><h1>Coupon Web</h1></div>
      <div>
        <Link to='/getCoupons/all'><h3>Get my coupon</h3></Link>
        <Link to='/getCoupons/category'><h3>Get my coupon by category</h3></Link>
        <Link to='/getCoupons/maxToPay'><h3>Get my coupon by maxToPay</h3></Link>
        <Link to='/addCoupon'><h3>Add coupon</h3></Link>
        <Link to='/updateCoupon'><h3>Update coupon</h3></Link>
        <Link to='/deleteCoupon'><h3>Delete coupon</h3></Link>
        <Link to='/getDetails'><h3>GetDetails coupon</h3></Link>

      </div>
    </div>
  )
}
